import React from "react";
import './Main.css';

const Main = () => {
    return (
        <section className='Main'>
            <div className="overlay"></div>
            <div className="backgroundImage" style={{ backgroundImage: "url('/background.jpg')" }}></div>
            <div className="mainContent container">
                <div className="cardDiv grid">
                    <span className="textDiv">Tìm kiếm chuyến đi</span>
                </div>
                <div className="banner">
                    <div className="container">
                        <input type="text start place" placeholder="Nơi xuất phát" name="startPlace" id='start' required></input>
                        <label for="startPlace" class="form__label">Nơi xuất phát</label>
                        {/* <input type="text destination" aria-label="Last name" class="form-control"></input> */}
                        <button className="action-button">Click Me</button>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default Main;
